  trait GenericAritySchematic[F[_]] extends Schematic[F] {
    final def struct[S](f: => S): F[S] = genericStruct(Vector.empty)(_ => f)
    final def struct[Z, A0](a0: Field[F, Z, A0])(f: (A0) => Z): F[Z] = genericStruct(Vector(a0))(arr => f(arr(0).asInstanceOf[A0]))
    final def struct[Z, A0, A1](a0: Field[F, Z, A0], a1: Field[F, Z, A1])(f: (A0, A1) => Z): F[Z] = genericStruct(Vector(a0, a1))(arr => f(arr(0).asInstanceOf[A0], arr(1).asInstanceOf[A1]))
    final def struct[Z, A0, A1, A2](a0: Field[F, Z, A0], a1: Field[F, Z, A1], a2: Field[F, Z, A2])(f: (A0, A1, A2) => Z): F[Z] = genericStruct(Vector(a0, a1, a2))(arr => f(arr(0).asInstanceOf[A0], arr(1).asInstanceOf[A1], arr(2).asInstanceOf[A2]))
    final def struct[Z, A0, A1, A2, A3](a0: Field[F, Z, A0], a1: Field[F, Z, A1], a2: Field[F, Z, A2], a3: Field[F, Z, A3])(f: (A0, A1, A2, A3) => Z): F[Z] = genericStruct(Vector(a0, a1, a2, a3))(arr => f(arr(0).asInstanceOf[A0], arr(1).asInstanceOf[A1], arr(2).asInstanceOf[A2], arr(3).asInstanceOf[A3]))
